import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/PeripheralsPage.css'; // Import the CSS file

const PrebuiltPCPage = () => {
  const prebuiltPCData = [
    { id: '67ff122b30df75e438f334b2', name: 'ABS Master Gaming PC', image: 'data:image/jpeg;base64,', slug: 'abs-master-gaming-pc' },
  { id: '67ff122b30df75e438f334b3', name: 'CyberPowerPC Gamer Xtreme', image: 'data:image/jpeg;base64,', slug: 'cyberpowerpc-gamer-xtreme' },
  { id: '67ff122b30df75e438f334b4', name: 'iBUYPOWER Trace 5 MR', image: 'data:image/jpeg;base64,', slug: 'ibuypower-trace-5-mr' },
  { id: '67ff122b30df75e438f334b5', name: 'NZXT Player One', image: 'data:image/jpeg;base64,', slug: 'nzxt-player-one' },
  { id: '67ff122b30df75e438f334b6', name: 'Corsair Vengeance i7300', image: 'data:image/jpeg;base64,', slug: 'corsair-vengeance-i7300' },

  ];

  return (
    <div className="prebuiltpc-page">
      <h2>Browse Prebuilt PCs</h2>
      <div className="prebuiltpc-grid">
        {prebuiltPCData.map((pc) => (
          <Link to={`/product/${pc.id}`} key={pc.id} className="prebuiltpc-card">
            <img src={pc.image} alt={pc.name} />
            <h3>{pc.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default PrebuiltPCPage;
